      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 + + col1 + + + col2 NOT BETWEEN col1 AND col1 * 64;
  - name: tab1

outputs:
  - name: q12301.out
    data: |
      51	14	96
      85	5	59
      91	47	68
